    false,nt"url": null,nt"notes": "This annual narrative report for J. Clark
    Salyer Wetland Management District outlines Refuge accomplishments during the 1987
    calendar year. The report begins with a summary of the year's highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which discusses management planning and public participation. Refuge administration
    is outlined; information about personnel, youth programs, funding, safety, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    forests, croplands, grasslands, grazing, haying, fire management, pest control,
    water rights, and WPA easements. The wildlife section of the report discusses endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, and wildlife propagation. The public uses of the Refuge described
    in this report include hunting, trapping, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, equipment replacement, and energy conservation. Cooperative programs
    are provided at the end. Refuge brochures are attached. This narrative also includes
    summaries on Lords Lake, Willow Lake, Rabb Lake, School Section Lake, Buffalo Lake,
    Cottonwood Lake and Wintering River NWR.",nt"license_title": "License Not
